"""**Cantidad de reservas a lo largo del tiempo**

La cantidad de datos con respecto a las reservas se generan a partir de los aos 2022 y 2023, en este caso identificamos la cantidad de reservas generadas por mes en cada uno de esos aos, la intencin del analisis es identificar las temporadas altas y bajas con respecto a la demanda de habitaciones.
"""

#Generamos la importacin de las librerias para graficar.
import seaborn as sns
import matplotlib.pyplot as plt

#Usamos el campo "Booking Date" para utilizarlo como fecha de referencia.
Serenity_sands['Booking Date'] = pd.to_datetime(Serenity_sands['Booking Date'])

# Extraemos el ao y mes del campo "Booking Date", esto nos ayudara a graficar por ao y meses
Serenity_sands['Year Period'] = Serenity_sands['Booking Date'].dt.year
Serenity_sands['Month Period'] = Serenity_sands['Booking Date'].dt.month

# Agrupamos el mes y el ao para saber la cantidad de reservas realizadas.
reservas_por_mes = Serenity_sands.groupby(['Year Period', 'Month Period']).size().unstack()
reservas_por_mes

"""**Analisis grafico de reservas a lo largo del tiempo**

En este caso podemos identificar que en el ao 2023 la demanda mas alta fue para fin de ao, abarcando los meses de Noviembre y Diciembre, por otro lado en cuando al ao 2022 la temporada mas alta fue en el mes de Marzo, que iguala la cantidad de reservas del ao 2023 en el mismo mes, podriamos deducir del grafico que las temporadas de medio y fin de ao son las mas altas.
"""

# Reestructuramos  el DataFrame para Seaborn,se usa "Melt", esta funcin nos permite fabricar un pequeo dataset con datos comprimidos,
#como podemos ver, identificamos el ao, el mes y la cantidad de reservas de forma mas detallada para graficar.
reservas_por_mes2 = reservas_por_mes.melt(ignore_index=False).reset_index()
reservas_por_mes2

# Traemos la informacin anterior para graficar en seaborn
plt.figure(figsize=(12, 6))
sns.barplot(data=reservas_por_mes2, x='Month Period', y='value', hue='Year Period', palette="flare")

#Le brindamos informacin sobre los ajes al grfico
plt.title('Cantidad de reservas por mes y ao')
plt.xlabel('Mes')
plt.ylabel('Cantidad de reservas')
plt.legend(title='Ao', bbox_to_anchor=(1.05, 1), loc='upper left')
plt.xticks(rotation=0)

# Agregamos etiquetas de datos
for p in plt.gca().patches:
    plt.gca().annotate(int(p.get_height()), (p.get_x() + p.get_width() / 2., p.get_height()),
                       ha='center', va='bottom', fontsize=10, color='black', xytext=(0, 5),
                       textcoords='offset points')

#Generamos la visualizacin del grfico
plt.show()

